import numpy as npimport pandas as pdimport matplotlib.pyplot as pltimport scipy.stats as stimport statsmodels.api as smfrom statsmodels.graphics.tsaplots import plot_acf, plot_pacfplt.style.use('ggplot')df = pd.read_csv("CoffeePrice.csv", header = None)df.columns = ["month", "price"]month = df.monthprice = df.priceplt.rcParams.update({'figure.figsize':(9,7), 'figure.dpi':120})plot_acf(price,lags = 48)plot_pacf(price)difference = np.array([price[i] - price[i-1] for i in range(1,len(price))])plot_acf(difference,lags = 48)plot_pacf(difference)